import React from 'react';
import '../../App.css'
import classes from './Header.module.css'
import Link from '@mui/material/Link';

const Header = () => {
    return (
       <header className={classes.header}>
           <div className='container'>
               <Link href="#">Link</Link>
               <Link href="#">Link</Link>
               <Link href="#">Link</Link>
               <Link href="#">Link</Link>
           </div>
       </header>

    );
};

export default Header;
